import React from 'react';
import { FiMapPin, FiHome, FiLayers, FiDroplet, FiClock } from 'react-icons/fi';
import '../styles/PropertyListings.css';

const AllPropertiesPage = () => {
  const properties = [
    {
      id: 1,
      image: 'https://images.unsplash.com/photo-1564013799919-ab600027ffc6',
      price: 'CHF 2,300,000',
      beds: 4,
      baths: 3,
      sqft: 2800,
      status: 'Available',
      address: 'Zermatt, Switzerland',
      daysOnMarket: 5
    },
    // ... include all your properties from the original component
    // You might want to move this data to a shared file or context
  ];

  return (
    <main className="all-properties-page">
      <div className="listings-header">
        <h1 className="listings-title">All Swiss Chalets</h1>
        <p className="listings-subtitle">
          Browse our complete collection of luxury chalets across Switzerland
        </p>
      </div>

      <div className="properties-grid">
        {properties.map(property => (
          <div key={property.id} className="property-card">
            <div className="image-container">
              <img 
                src={property.image} 
                alt={property.address} 
                className="property-image" 
                loading="lazy"
              />
              <div className="property-badge">{property.status}</div>
            </div>
            <div className="property-details">
              <span className="days-on-market">
                <FiClock /> {property.daysOnMarket} days listed
              </span>
              <div className="property-price">{property.price}</div>
              <div className="property-address">
                <FiMapPin /> {property.address}
              </div>
              <div className="property-meta">
                <span><FiHome /> {property.beds} bedrooms</span>
                <span><FiDroplet /> {property.baths} baths</span>
                <span><FiLayers /> {property.sqft.toLocaleString()} sqft</span>
              </div>
            </div>
          </div>
        ))}
      </div>
    </main>
  );
};

export default AllPropertiesPage;
